import React from "react";
import "./Navigation.css";

const Navigation = () => {
    return (
        <nav className="navbar">
            <div>
                <p>Savings Calculator by John Bender</p>
            </div>
            <div>
                <p><a href="https://github.com/jbenderdev/savings-calculator/blob/master/README.md">About</a></p>
            </div>
        </nav>
    )
}

export default Navigation;
